import React from 'react';
import { Navbar, Footer } from '../components';
// import "./productLineage.css";

const ProductLineage = () => {
  return (
    <div>
      <Navbar />
      <div className='productLineage'>
        <h1>Experience the Future of Reporting with AI.</h1>
        <div className="button-container">
          <div className="button-container-insurance">
          <img src={process.env.PUBLIC_URL + '/assets/medical.png'} alt="Insurance Icon" />

            <a href="#" className="button">Insurance</a>
          </div>
          <div className="button-container-diagnostic">
            <img src="src/assets/3775102.png" alt="Diagnostic Icon" />
            <a href="#" className="button">Diagnostic</a>
          </div>
        </div>
      </div>
      <Footer />
    </div>
  );
};

export default ProductLineage;
